import React, { Component } from 'react'
import Result from './Result';
import Navbar from './Navbar';

export default class App extends Component {
  render() {
    return (
     <div>
        <Navbar/>
        <div class="jumbotron jumbotron-fluid">
          <div class="container">
          <Result/>
        </div>
        </div>
      </div>
    )
  }
}
